-- ----------------------------
--  Table structure for `crm_admin`
-- ----------------------------
DROP TABLE IF EXISTS `crm_admin`;
CREATE TABLE `crm_admin` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `admin_name` varchar(32) NOT NULL COMMENT '用户名',
  `admin_password` varchar(64) NOT NULL COMMENT '密码',
  `admin_status` tinyint(4) DEFAULT NULL COMMENT '用户状态',
  `admin_job` varchar(32) DEFAULT NULL COMMENT '职务',
  `admin_real_name` varchar(20) NOT NULL COMMENT '真实姓名',
  `admin_phone` varchar(11) DEFAULT NULL COMMENT '手机',
  `admin_dep` bigint(20) NOT NULL COMMENT '所属部门',
  `is_dep_manager` tinyint(4) DEFAULT NULL COMMENT '是否为部门管理员',
  `admin_last_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '上次登录时间',
  `is_del` bit(1) DEFAULT b'0' COMMENT '删除标识',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COMMENT='管理员';

