-- ----------------------------
--  Table structure for `crm_customer`
-- ----------------------------
DROP TABLE IF EXISTS `crm_customer`;
CREATE TABLE `crm_customer` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `cust_name` varchar(128) DEFAULT NULL COMMENT '姓名',
  `cust_role` tinyint(4) DEFAULT NULL COMMENT '客户角色',
  `cust_phone` varchar(1024) DEFAULT NULL COMMENT '电话号码',
  `cust_qq` varchar(1024) DEFAULT NULL COMMENT 'qq号码',
  `cust_email` varchar(1024) DEFAULT NULL COMMENT '邮箱',
  `cust_job` varchar(32) DEFAULT NULL COMMENT '职务',
  `is_del` bit(1) NOT NULL DEFAULT b'0' COMMENT '删除标识 0 否 1 是',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_crm_customer_on_cust_phone` (`cust_phone`(255))
) ENGINE=InnoDB AUTO_INCREMENT=804 DEFAULT CHARSET=utf8 COMMENT='客户联系人表';

