-- ----------------------------
--  Procedure structure for `contractPaths`
-- ----------------------------
DROP PROCEDURE IF EXISTS `contractPaths`;
delimiter ;;
CREATE DEFINER=`vcooline`@`%` PROCEDURE `contractPaths`()
BEGIN
	DECLARE contractId INT;
	DECLARE accessoryName VARCHAR(255);

	DECLARE done INT DEFAULT FALSE;
	DECLARE clue_cur CURSOR FOR SELECT cc.id,cc.cont_accessory_name FROM crm_contract cc WHERE cc.cont_accessory_name IS NOT NULL;

	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

	OPEN clue_cur;
			emp_loop: LOOP
				IF done THEN
					SELECT '更新成功';
					LEAVE emp_loop;
				END IF;
				FETCH clue_cur INTO contractId,accessoryName;
				INSERT INTO crm_contract_file(file_type,target_id,file_name,created_at,updated_at)VALUES(0,contractId,accessoryName,NOW(),NOW());
				UPDATE crm_contract SET cont_accessory_name = NULL WHERE id = contractId;
			END LOOP;
	CLOSE clue_cur;
END
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `fenpei`
-- ----------------------------
DROP PROCEDURE IF EXISTS `fenpei`;
delimiter ;;
CREATE DEFINER=`vcooline`@`%` PROCEDURE `fenpei`()
BEGIN
	DECLARE clue_create_time TIMESTAMP;
	DECLARE clue_id BIGINT;
	DECLARE clueCount int;
	DECLARE clueOwnerId int;
	DECLARE clueOwnerName VARCHAR(255);

	DECLARE done INT DEFAULT FALSE;
	DECLARE clue_cur CURSOR FOR SELECT id,create_time FROM crm_clue WHERE `owner` = 1 LIMIT 0,5;

	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

	SELECT COUNT(0) INTO clueCount FROM crm_clue WHERE `owner` = 1 LIMIT 0,5;

	OPEN clue_cur;
		WHILE clueCount > 0 DO
			FETCH clue_cur INTO clue_id,clue_create_time;
			SET clueCount = clueCount - 1;
			IF clueCount > 200 THEN
				SELECT id,admin_real_name INTO clueOwnerId,clueOwnerName FROM crm_admin WHERE id = 14;
			ELSE
				SELECT id,admin_real_name INTO clueOwnerId,clueOwnerName FROM crm_admin WHERE id = 20;
			END IF;
			UPDATE crm_clue SET `owner` = clueOwnerId,`owner_name` = clueOwnerName,`allot_time` = NOW() WHERE `id` = clue_id;
			INSERT crm_allocation_log(allo_type,target_id,allo_source,allo_admin,allo_owner,create_time) VALUES(1,clue_id,1,1,clueOwnerId,NOW());
		END WHILE;
	CLOSE clue_cur;
END
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `insert_create_long`
-- ----------------------------
DROP PROCEDURE IF EXISTS `insert_create_long`;
delimiter ;;
CREATE DEFINER=`vcooline`@`%` PROCEDURE `insert_create_long`()
BEGIN
	DECLARE clue_create_time TIMESTAMP;
	DECLARE clue_id BIGINT;

	DECLARE done INT DEFAULT FALSE;
	DECLARE clue_cur CURSOR FOR SELECT id,create_time FROM crm_clue;

	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

	OPEN clue_cur;
		emp_loop: LOOP
			FETCH clue_cur INTO clue_id,clue_create_time;
			IF done THEN
				SELECT '更新成功';
				LEAVE emp_loop;
			END IF;

			-- UPDATE crm_clue cc SET cc.create_time_long = UNIX_TIMESTAMP(DATE_FORMAT(clue_create_time,'%Y-%m-%d %H:%i:%S')) WHERE cc.id = clue_id;
			UPDATE crm_clue cc SET cc.clue_number = CONCAT(SUBSTRING(cc.clue_number,1,6),'000',SUBSTRING(cc.clue_number,7)) WHERE cc.id = clue_id AND cc.num_code = 1;

		END LOOP;
		CLOSE clue_cur;
END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `getChildList`
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildList`;
delimiter ;;
CREATE DEFINER=`root`@`%` FUNCTION `getChildList`(rootId BIGINT(32)) RETURNS varchar(1000) CHARSET utf8
BEGIN
    DECLARE sTemp VARCHAR(1000);
    DECLARE sTempChd VARCHAR(1000);

    SET sTemp = '$';
	SELECT ca.admin_dep INTO sTempChd FROM crm_admin ca WHERE ca.id = rootId;

    WHILE sTempChd IS NOT NULL DO
      SET sTemp = CONCAT(sTemp, ',', sTempChd);
      SELECT
        GROUP_CONCAT(id)
      INTO sTempChd
      FROM crm_dep
      WHERE FIND_IN_SET(CAST(parent_id AS CHAR), sTempChd) > 0;
    END WHILE;
    RETURN sTemp;
  END
 ;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
